import React from "react";
import Header from "../header";
import "./italy.css"; 
import Chatbot from "../chatbot";

const Food = () => {
  const cardData = [
    { src: "assets/pasta", alt: "Chef with Tunisian flag", link: "#" },
    { src: "assets/south africa.png", alt: "Chef with South African flag", link: "#" },
    { src: "assets/masr.png", alt: "Chef with Egyptian flag", link: "#" },
    { src: "assets/italy.png", alt: "Chef with Italian flag", link: "#" },
    
  ];

  return (
    <div className="food">
      
      <Header/>

      
      <div className="hero">
        
      </div>

     
      <div className="grid">
        {cardData.map((card, index) => (
          <div className="card" key={index}>
            <a href={card.link}>
              <img src={card.src} alt={card.alt} className="card-image" />
            </a>
          </div>
        ))}
      </div>
      <Chatbot/>
    </div>
  );
};

export default Food;
